import React from 'react'
import fetch from 'node-fetch'

var parser = require('fast-xml-parser');

function fetchData(url) {
  return new Promise((resolve, reject) => {
    fetch(url)
      .then(res => res.text())
      .then(body => resolve(body))
  })
}

const MainComponent = (props) => {
  let books = props.GoodreadsResponse.search.results.work;
  let bookElements = [];

  for (let i = 0; i < books.length; i++) {
    bookElements.push(
      <div class="book">
        {books[i].best_book.title}
      </div>
    );
  }

  return (
    <div>
      {bookElements}
    </div>
  )
}

MainComponent.getInitialProps = async () => {
  let data = await fetchData("https://www.goodreads.com/book/show?id=26050611-good-profit&format=json");

  return JSON.parse(data);
}

export default MainComponent
